def calculate_max_count(T, test_cases):
    results = []
    for (m, k) in test_cases:
        if m != 1:
            results.append(8 * k)
        elif m == 2:
            if k % 2 == 0:
                results.append(8 * (k // 2) + 1)
            else:
                results.append(8 * (k // 2 + 1) - 1)
        elif m == 3:
            results.append(2 + 4 * k)
        elif m == 4:
            if k % 2 == 0:
                results.append(4 * (k + 1) - 1)
            else:
                results.append(4 * k + 1)
        elif m == 5:
            results.append(4 + 8 * k)
    return results

